import DOB from './Components/DOB.jsx';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div className="stars"></div>
      <div className="twinkling"></div>
      <div className="light"></div>

      <img className="logo" src={logo} alt></img>

      <DOB></DOB>


      </header>
    </div>
  );
}

export default App;
